ls/request\'\\n\\nconst request = (url, ...arg) => baseRequest(`/biz/mqttstorebinding/` + url, ...arg)\\n\\n/**\\n * MQTT配置-店铺关联表Api接口管理器\\n *\\n * @author ChenCheng\\n * @date  2025/07/18 22:07\\n **/\\nexport default {\\n\\t// 获取MQTT配置-店铺关联表分页\\n\\tmqttStoreBindingPage(data) {\\n\\t\\treturn request(\'page\', data, \'get\')\\n\\t},\\n\\t// 提交MQTT配置-店铺关联表表单 edit为true时为编辑，默认为新增\\n\\tmqttStoreBindingSubmitForm(data, edit = false) {\\n\\t\\treturn request(edit ? \'edit\' : \'add\', data)\\n\\t},\\n\\t// 删除MQTT配置-店铺关联表\\n\\tmqttStoreBindingDelete(data) {\\n\\t\\treturn request(\'delete\', data)\\n\\t},\\n\\t// 获取MQTT配置-店铺关联表详情\\n\\tmqttStoreBindingDetail(data) {\\n\\t\\treturn request(\'detail\', data, \'get\')\\n\\t}\\n}\\n\"},{\"codeFileName\":\"form.vue\",\"codeFileWithPathName\":\"views/biz/mqttstorebinding/form.vue\",\"codeFileContent\":\"<template>\\n    <xn-form-container\\n        :title=\\\"formData.id ? \'编辑MQTT配置-店铺关联表\' : \'增加MQTT配置-店铺关联表\'\\\"\\n        :width=\\\"700\\\"\\n        v-model:open=\\\"open\\\"\\n        :destroy-on-close=\\\"true\\\"\\n        @close=\\\"onClose\\\"\\n    >\\n        <a-form ref=\\\"formRef\\\" :model=\\\"formData\\\" :rules=\\\"formRules\\\" layout=\\\"vertical\\\">\\n            <a-row :gutter=\\\"16\\\">\\n                <a-col :span=\\\"12\\\">\\n                    <a-form-item label=\\\"排序码：\\\" name=\\\"sortCode\\\">\\n                        <a-input v-model:value=\\\"formData.sortCode\\\" placeholder=\\\"请输入排序码\\\" allow-clear />\\n                    </a-form-item>\\n                </a-col>\\n                <a-col :span=\\\"12\\\">\\n                    <a-form-item label=\\\"扩展信息：\\\" name=\\\"extJson\\\">\\n                        <a-input v-model:value=\\\"formData.extJson\\\" placeholder=\\\"请输入扩展信息\\\" allow-clear />\\n                    </a-form-item>\\n                </a-col>\\n                <a-col :span=\\\"12\\\">\\n                    <a-form-item label=\\\"MQTT配置ID：\\\" name=\\\"configId\\\">\\n                        <a-input v-model:value=\\\"formData.configId\\\" placeholder=\\\"请输入MQTT配置ID\\\" allow-clear />\\n                    </a-form-item>\\n                </a-col>\\n                <a-col :span=\\\"12\\\">\\n                    <a-form-item label=\\\"门店编码：\\\" name=\\\"storeCode\\\">\\n                        <a-input v-model:value=\\\"formData.storeCode\\\" placeholder=\\\"请输入门店编码\\\" allow-clear />\\n                    </a-form-item>\\n                </a-col>\\n                <a-col :span=\\\"12\\\">\\n                    <a-form-item label=\\\"绑定状态(A=有效,I=无效)：\\\" name=\\\"bindStatus\\\">\\n                        <a-radio-group v-model:value=\\\"formData.bindStatus\\\" placeholder=\\\"请选择绑定状态(A=有效,I=无效)\\\" :options=\\\"bindStatusOptions\\\" />\\n                    </a-form-item>\\n                </a-col>\\n                <a-col :span=\\\"12\\\">\\n                    <a-form-item label=\\\"绑定时间：\\\" name=\\\"bindTime\\\">\\n                        <a-date-picker v-model:value=\\\"formData.bindTime\\\" value-format=\\\"YYYY-MM-DD HH:mm:ss\\\" show-time placeholder=\\\"请选择绑定时间\\\" style=\\\"width: 100%\\\" />\\n                    </a-form-item>\\n                </a-col>\\n                <a-col :span=\\\"12\\\">\\n                    <a-form-item label=\\\"解绑时间：\\\" name=\\\"unbindTime\\\">\\n                        <a-date-picker v-model:value=\\\"formData.unbindTime\\\" value-format=\\\"YYYY-MM-DD HH:mm:ss\\\" show-time placeholder=\\\"请选择解绑时间\\\" style=\\\"width: 100%\\\" />\\n                    </a-form-item>\\n                </a-col>\\n            </a-row>\\n        </a-form>\\n        <template #footer>\\n            <a-button style=\\\"margin-right: 8px\\\" @click=\\\"onClose\\\">关闭</a-button>\\n            <a-button type=\\\"primary\\\" @click=\\\"onSubmit\\\" :loading=\\\"submitLoading\\\">保存</a-button>\\n        </template>\\n    </xn-form-container>\\n</template>\\n\\n<script setup name=\\\"mqttStoreBindingForm\\\">\\n    im