qttStoreBinding::getStoreCode, mqttStoreBindingPageParam.getStoreCode());\\n        }\\n        if(ObjectUtil.isAllNotEmpty(mqttStoreBindingPageParam.getSortField(), mqttStoreBindingPageParam.getSortOrder())) {\\n            CommonSortOrderEnum.validate(mqttStoreBindingPageParam.getSortOrder());\\n            queryWrapper.orderBy(true, mqttStoreBindingPageParam.getSortOrder().equals(CommonSortOrderEnum.ASC.getValue()),\\n                    StrUtil.toUnderlineCase(mqttStoreBindingPageParam.getSortField()));\\n        } else {\\n            queryWrapper.lambda().orderByAsc(MqttStoreBinding::getSortCode);\\n        }\\n        return this.page(CommonPageRequest.defaultPage(), queryWrapper);\\n    }\\n\\n    @Transactional(rollbackFor = Exception.class)\\n    @Override\\n    public void add(MqttStoreBindingAddParam mqttStoreBindingAddParam) {\\n        MqttStoreBinding mqttStoreBinding = BeanUtil.toBean(mqttStoreBindingAddParam, MqttStoreBinding.class);\\n        this.save(mqttStoreBinding);\\n    }\\n\\n    @Transactional(rollbackFor = Exception.class)\\n    @Override\\n    public void edit(MqttStoreBindingEditParam mqttStoreBindingEditParam) {\\n        MqttStoreBinding mqttStoreBinding = this.queryEntity(mqttStoreBindingEditParam.getId());\\n        BeanUtil.copyProperties(mqttStoreBindingEditParam, mqttStoreBinding);\\n        this.updateById(mqttStoreBinding);\\n    }\\n\\n    @Transactional(rollbackFor = Exception.class)\\n    @Override\\n    public void delete(List<MqttStoreBindingIdParam> mqttStoreBindingIdParamList) {\\n        // 执行删除\\n        this.removeByIds(CollStreamUtil.toList(mqttStoreBindingIdParamList, MqttStoreBindingIdParam::getId));\\n    }\\n\\n    @Override\\n    public MqttStoreBinding detail(MqttStoreBindingIdParam mqttStoreBindingIdParam) {\\n        return this.queryEntity(mqttStoreBindingIdParam.getId());\\n    }\\n\\n    @Override\\n    public MqttStoreBinding queryEntity(String id) {\\n        MqttStoreBinding mqttStoreBinding = this.getById(id);\\n        if(ObjectUtil.isEmpty(mqttStoreBinding)) {\\n            throw new CommonException(\\\"MQTT配置-店铺关联表不存在，id值为：{}\\\", id);\\n        }\\n        return mqttStoreBinding;\\n    }\\n\\n}\\n\"}],\"genBasicCodeMobileResultList\":[{\"codeFileName\":\"page.json\",\"codeFileWithPathName\":\"/page.json\",\"codeFileContent\":\"// 二选一 将代码复制到page.json文件中\\n\\n// 不使用分包\\n{\\n    \\\"path\\\": \\\"pages/biz/mqttstorebinding/index\\\",\\n    \\\"style\\\": {\\n        \\\"navigationBarTitleText\\\": \\\"MQTT配置-店铺关联表管理\\\",\\n        \\\"enablePullDownRefresh\\\": false,\\n        //#ifdef H5\\n        \\\"navigationStyle\\\": \\\"custom\\\"\\n        //#endif\\n    }\\n}, {\\n    \\\"path\\\": \\\"pages/biz/mqttstorebinding/form\\\",\\n    \\\"style\\\": {\\n        \\\"navigationBarTitleText\\\": \\\"MQTT配置-店铺关联表管理\\\",\\n        \\\"enablePullDownRefresh\\\": false,\\n        //#ifdef H5\\n        \\\"navigationStyle\\\": \\\"custom\\\"\\n        //#endif\\n    }\\n},\\n\\n\\n// 使用分包（微信小程序开发主包不能超过2m，所以建议使用分包）\\n{\\n    \\\"root\\\": \\\"pages/biz/mqttstorebinding\\\",\\n    \\\"pages\\\": [{\\n        \\\"path\\\": \\\"index\\\",\\n        \\\"style\\\": {\\n            \\\"navigationBarTitleText\\\": \\\"MQTT配置-店铺关联表管理\\\",\\n            \\\"enablePullDownRefresh\\\": false,\\n            //#ifdef H5\\n            \\\"navigationStyle\\\": \\\"custom\\\"\\n            //#endif\\n        }\\n    },{\\n        \\\"path\\\": \\\"form\\\",\\n        \\\"style\\\": {\\n            \\\"navigationBarTitleText\\\": \\\"MQTT配置-店铺关联表管理\\\",\\n            \\\"enablePullDownRefresh\\\": false,\\n            //#ifdef H5\\n            \\\"navigationStyle\\\": \\\"custom\\\"\\n            //#endif\\n        }\\n    }]\\n}\\n\"},{\"codeFileName\":\"mqtt-store-binding-api.js\",\"codeFileWithPathName\":\"api/biz/mqtt-store-binding-api.js\",\"codeFileContent\":\"import request from \'@/utils/request\'\\n\\nexport default {\\n    // 获取MQTT配置-店铺关联表分页\\n    mqttStoreBindingPage(data) {\\n        return request({\\n            url: \'/biz/mqttstorebinding/page\',\\n            method: \'GET\',\\n            data: data\\n        })\\n    },\\n    // 提交MQTT配置-店铺关联表表单 add为false时为编辑，默认为新增\\n    mqttStoreBindingSubmitForm(data, add = true) {\\n        return request({\\n            url: \'/biz/mqttstorebinding/\'+ (add ? \'add\' : \'edit\'),\\n            method: \'POST\',\\n            data: data\\n        })\\n    },\\n    // 删除MQTT配置-店铺关联表\\n    mqttStoreBindingDelete(data) {\\n        return request({\\n            url: \'/biz/mqttstorebinding/delete\',\\n            method: \'POST\',\\n            data: data\\n        })\\n    },\\n    // 获取MQTT配置-店铺关联表详情\\n    mqttStoreBindingDetail(data) {\\n        return request({\\n            url: \'/biz/mqttstorebinding/detail\',\\n            method: \'GET\',\\n            data: data\\n        })\\n    },\\n}\\n\"},{\"codeFileName\":\"search.vue\",\"codeFileWithPathName\":\"pages/biz/mqttstorebinding/search.vue\",\"codeFileContent\":\"<template>\\n    <uni-popup ref=\\\"popRef\\\" type=\\\"bottom\\\" background-color=\\\"transparent\\\" maskBackgroundColor=\\\"rgba(0, 0, 0, 0.6)\\\">\\n        <view class=\\\"snowy-shadow snowy-padding\\\">\\n            <view class=\\\"snowy-flex-end\\\">\\n            \\t<icon type=\\\"clear\\\" :size=\\\"20\\\" color=\\\"#5677fc\\\" @click=\\\"close\\\"></icon>\\n            </view>\\n            <uni-forms ref=\\\"formRef\\\" :model=\\\"searchFormData\\\" label-position=\\\"top\\\" labelWidth=\\\"auto\\\">\\n                <uni-forms-item label=\\\"MQTT配置ID\\\" name=\\\"configId\\\">\\n                    <uni-easyinput v-model=\\\"searchFormData.configId\\\" placeholder=\\\"请输入MQTT配置ID\\\"></uni-easyinput>\\n                </uni-forms-item>\\n                <uni-forms-item label=\\\"门店编码\\\" name=\\\"storeCode\\\">\\n                    <uni-easyinput v-model=\\\"searchFormData.storeCode\\\" placeholder=\\\"请输入门店编码\\\"></uni-easyinput>\\n                </uni-forms-item>\\n            </uni-forms>\\n            <uni-row :gutter=\\\"10\\\">\\n                <uni-col :span=\\\"12\\\">\\n                    <tui-button height=\\\"90rpx\\\" type=\\\"gray\\\" @click=\\\"reset\\\">重置</tui-button>\\n            \\t</uni-col>\\n            \\t<uni-col :span=\\\"12\\\">\\n                    <tui-button height=\\\"90rpx\\\" type=\\\"primary\\\" @click=\\\"confirm\\\">确认</tui-button>\\n            \\t</uni-col>\\n            </uni-row>\\n        </view>\\n    </uni-popup>\\n</template>\\n<script setup name=\\\"mqttStoreBindingSearch\\\">\\n    import { ref } from \\\"vue\\\"\\n    const emits = defineEmits([\'reset\', \'confirm\'])\\n    const props = defineProps({\\n    \\tsearchFormData: {\\n            type: Object,\\n            required: true\\n    \\t},\\n    })\\n\\n    // 弹出ref\\n    const popRef = ref()\\n    // 打开\\n    const open = () => {\\n    \\tpopRef.value.open()\\n    }\\n    const reset = () =>{\\n        // 重置数据\\n        props.searchFormData.configId = \'\'\\n        props.searchFormData.storeCode = \'\'\\n    \\temits(\'reset\', props.searchFormData)\\n    }\\n    const confirm = () => {\\n    \\tpopRef.value.close()\\n    \\temits(\'confirm\', props.searchFormData)\\n    }\\n    const close = () => {\\n    \\tpopRef.value.close()\\n    }\\n    defineExpose({\\n    \\topen\\n    })\\n</script>\\n<style lang=\\\"scss\\\" scoped>\\n</style>\\n\"},{\"codeFileName\":\"form.vue\",\"codeFileWithPathName\":\"pages/biz/mqttstorebinding/form.vue\",\"codeFileContent\":\"<template>\\n    <view class=\\\"snowy-form\\\">\\n        <uni-forms ref=\\\"formRef\\\" :model=\\\"formData\\\" label-position=\\\"top\\\" :rules=\\\"rules\\\" validate-trigger=\\\"blur\\\" labelWidth=\\\"auto\\\">\\n            <uni-forms-item label=\\\"排序码\\\" name=\\\"sortCode\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请输入排序码\' }]\\\">\\n            \\t<uni-easyinput v-model=\\\"formData.sortCode\\\" placeholder=\\\"请输入排序码\\\"></uni-easyinput>\\n            </uni-forms-item>\\n            <uni-forms-item label=\\\"扩展信息\\\" name=\\\"extJson\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请输入扩展信息\' }]\\\">\\n            \\t<uni-easyinput v-model=\\\"formData.extJson\\\" placeholder=\\\"请输入扩展信息\\\"></uni-easyinput>\\n            </uni-forms-item>\\n            <uni-forms-item label=\\\"MQTT配置ID\\\" name=\\\"configId\\\" :required=\\\"true\\\" :rules=\\\"[{ required: true, errorMessage: \'请输入MQTT配置ID\' }]\\\">\\n            \\t<uni-easyinput v-model=\\\"formData.configId\\\" placeholder=\\\"请输入MQTT配置ID\\\"></uni-easyinput>\\n            </uni-forms-item>\\n            <uni-forms-item label=\\\"门店编码\\\" name=\\\"storeCode\\\" :required=\\\"true\\\" :rules=\\\"[{ required: true, errorMessage: \'请输入门店编码\' }]\\\">\\n            \\t<uni-easyinput v-model=\\\"formData.storeCode\\\" placeholder=\\\"请输入门店编码\\\"></uni-easyinput>\\n            </uni-forms-item>\\n            <uni-forms-item label=\\\"绑定状态(A=有效,I=无效)\\\" name=\\\"bindStatus\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请选择绑定状态(A=有效,I=无效)\' }]\\\">\\n                <uni-data-checkbox :multiple=\\\"false\\\" :map=\\\"{key: \'value\', label: \'text\'}\\\" v-model=\\\"formData.bindStatus\\\" :rangeData=\\\"bindStatusOptions\\\" placeholder=\\\"请选择绑定状态(A=有效,I=无效)\\\"> </uni-data-checkbox>\\n            </uni-forms-item>\\n            <uni-forms-item label=\\\"绑定时间\\\" name=\\\"bindTime\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请选择绑定时间\' }]\\\">\\n                <uni-datetime-picker type=date v-model=\\\"formData.bindTime\\\" > </uni-datetime-picker>\\n            </uni-forms-item>\\n            <uni-forms-item label=\\\"解绑时间\\\" name=\\\"unbindTime\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请选择解绑时间\' }]\\\">\\n                <uni-datetime-picker type=date v-model=\\\"formData.unbindTime\\\" > </uni-datetime-picker>\\n            </uni-forms-item>\\n        </uni-forms>\\n        <tui-button margin=\\\"50rpx 0\\\" :preventClick=\\\"true\\\" :shadow=\\\"true\\\" @click=\\\"submit\\\">提交</tui-button>\\n    </view>\\n</template>\\n\\n<script setup name=\\\"mqttStoreBindingForm\\\">\\n    import { onLoad } from \\\"@dcloudio/uni-app\\\"\\n    import mqttStoreBindingApi from \'@/api/biz/mqtt-store-binding-api\'\\n    import { reactive, ref, getCurrentInstance } from \\\"vue\\\"\\n    import CallbackState from \\\"@/enum/callback-state\\\"\\n\\n    const { proxy } = getCurrentInstance()\\n    const formRef = ref()\\n    const formData = ref({})\\n    // 常用正则规则大全：https://any86.github.io/any-rule/\\n    // 去pages/biz/user/form.vue中寻找示例\\n    const rules = reactive({\\n    })\\n    const bindStatusOptions = ref([])\\t\\n    onLoad((option) => {\\n        bindStatusOptions.value = uni.$snowy.tool.dictList(\'OPEN_OFF\')\\n        if(!option.id){\\n            return\\n        }\\n        mqttStoreBindingApi.mqttStoreBindingDetail({\\n            id: option.id\\n        }).then(data => {\\n            formData.value = data\\n        })\\n    })\\n    const submit = () => {\\n        const submit = () => {\\n            formRef.value.validate().then(res => {\\n                mqttStoreBindingApi.mqttStoreBindingSubmitForm(formData.value, !formData.value.id).then(data => {\\n                    uni.$emit(\'formBack\', {\\n                        data: data\\n                    })\\n                    uni.navigateBack({\\n                        delta: 1\\n                    })\\n                })\\n            })\\n        }\\n    }\\n</script>\\n<style lang=\\\"scss\\\" scoped>\\n</style>\\n\"},{\"codeFileName\":\"more.vue\",\"codeFileWithPathName\":\"pages/biz/mqttstorebinding/more.vue\",\"codeFileContent\":\"<template>\\n    <uni-popup ref=\\\"popRef\\\" type=\\\"bottom\\\" background-color=\\\"transparent\\\" maskBackgroundColor=\\\"rgba(0, 0, 0, 0.6)\\\">\\n        <tui-list-view unlined=\\\"all\\\" background-color=\\\"transparent\\\">\\n            <tui-list-cell v-if=\\\"$snowy.hasPerm(\'mobileMqttStoreBindingEdit\')\\\" :hover=\\\"true\\\" :arrow=\\\"false\\\" @click=\\\"edit\\\" :radius=\\\"10\\\" >\\n                <view class=\\\"snowy-text-center\\\"> 编辑 </view>\\n            </tui-list-cell>\\n            <tui-list-cell v-if=\\\"$snowy.hasPerm(\'mobileMqttStoreBindingDelete\')\\\" :hover=\\\"true\\\" :arrow=\\\"false\\\" @click=\\\"del\\\" :radius=\\\"10\\\" :margin-top=\\\"2\\\">\\n                <view class=\\\"snowy-text-center\\\"> 刪除 </view>\\n            </tui-list-cell>\\n            <tui-list-cell :hover=\\\"true\\\" :arrow=\\\"false\\\" @click=\\\"cancel\\\" :margin-top=\\\"10\\\" :radius=\\\"10\\\">\\n                <view class=\\\"snowy-text-center\\\"> 取消 </view>\\n            </tui-list-cell>\\n        </tui-list-view>\\n    </uni-popup>\\n</template>\\n<script setup name=\\\"mqttStoreBindingMore\\\">\\n    import mqttStoreBindingApi from \'@/api/biz/mqtt-store-binding-api\'\\n    import { reactive, ref, getCurrentInstance } from \\\"vue\\\"\\n\\n    const emits = defineEmits([\'handleOk\'])\\n    const popRef = ref()\\n    const record = ref({})\\n    const open = (data) => {\\n    \\trecord.value = data\\n    \\tpopRef.value.open()\\n    }\\n    // 编辑\\n    const edit = () => {\\n    \\tuni.navigateTo({\\n            url: \'/pages/biz/mqttstorebinding/form?id=\' + record.value.id\\n    \\t})\\n    \\tpopRef.value.close()\\n    }\\n    // 删除\\n    const del = () => {\\n    \\tuni.$snowy.modal.confirm(`确定要删除吗？`).then(() => {\\n            mqttStoreBindingApi.mqttStoreBindingDelete([{\\n                id: record.value.id\\n            }]).then(data => {\\n                emits(\'handleOk\')\\n                popRef.value.close()\\n            })\\n    \\t})\\n    }\\n    // 取消\\n    const cancel = () => {\\n    \\tpopRef.value.close()\\n    }\\n    defineExpose({\\n    \\topen\\n    })\\n</script>\\n<style lang=\\