nt\":\"import { baseRequest } from \'@/utils/request\'\\n\\nconst request = (url, ...arg) => baseRequest(`/biz/mqttconnectionconfig/` + url, ...arg)\\n\\n/**\\n * MQTT连接配置表Api接口管理器\\n *\\n * @author Chan\\n * @date  2025/07/18 22:40\\n **/\\nexport default {\\n\\t// 获取MQTT连接配置表分页\\n\\tmqttConnectionConfigPage(data) {\\n\\t\\treturn request(\'page\', data, \'get\')\\n\\t},\\n\\t// 提交MQTT连接配置表表单 edit为true时为编辑，默认为新增\\n\\tmqttConnectionConfigSubmitForm(data, edit = false) {\\n\\t\\treturn request(edit ? \'edit\' : \'add\', data)\\n\\t},\\n\\t// 删除MQTT连接配置表\\n\\tmqttConnectionConfigDelete(data) {\\n\\t\\treturn request(\'delete\', data)\\n\\t},\\n\\t// 获取MQTT连接配置表详情\\n\\tmqttConnectionConfigDetail(data) {\\n\\t\\treturn request(\'detail\', data, \'get\')\\n\\t}\\n}\\n\"},{\"codeFileName\":\"form.vue\",\"codeFileWithPathName\":\"views/biz/mqttconnectionconfig/form.vue\",\"codeFileContent\":\"<template>\\n    <xn-form-container\\n        :title=\\\"formData.id ? \'编辑MQTT连接配置表\' : \'增加MQTT连接配置表\'\\\"\\n        :width=\\\"700\\\"\\n        v-model:open=\\\"open\\\"\\n        :destroy-on-close=\\\"true\\\"\\n        @close=\\\"onClose\\\"\\n    >\\n        <a-form ref=\\\"formRef\\\" :model=\\\"formData\\\" :rules=\\\"formRules\\\" layout=\\\"vertical\\\">\\n            <a-row :gutter=\\\"16\\\">\\n                <a-col :span=\\\"12\\\">\\n                    <a-form-item label=\\\"主机地址：\\\" name=\\\"serverHost\\\">\\n                        <a-input v-model:value=\\\"formData.serverHost\\\" placeholder=\\\"请输入主机地址\\\" allow-clear />\\n                    </a-form-item>\\n                </a-col>\\n                <a-col :span=\\\"12\\\">\\n                    <a-form-item label=\\\"端口号（如1883）：\\\" name=\\\"serverPort\\\">\\n                        <a-input-number v-model:value=\\\"formData.serverPort\\\" :min=\\\"1\\\" :max=\\\"10000\\\" style=\\\"width: 100%\\\" />\\n                    </a-form-item>\\n                </a-col>\\n                <a-col :span=\\\"12\\\">\\n                    <a-form-item label=\\\"用户名：\\\" name=\\\"username\\\">\\n                        <a-input v-model:value=\\\"formData.username\\\" placeholder=\\\"请输入用户名\\\" allow-clear />\\n                    </a-form-item>\\n                </a-col>\\n                <a-col :span=\\\"12\\\">\\n                    <a-form-item label=\\\"密码：\\\" name=\\\"password\\\">\\n                        <a-input v-model:value=\\\"formData.password\\\" placeholder=\\\"请输入密码\\\" allow-clear />\\n                    </a-form-item>\\n                </a-col>\\n                <a-col :span=\\\"12\\\">\\n                    <a-form-item label=\\\"客户端ID前缀：\\\" name=\\\"clientIdPrefix\\\">\\n                        <a-input v-model:value=\\\"formData.clientIdPrefix\\\" placeholder=\\\"请输入客户端ID前缀\\\" allow-clear />\\n                    </a-form-item>\\n                </a-col>\\n                <a-col :span=\\\"12\\\">\\n                    <a-form-item label=\\\"是否清除会话（0=false, 1=true）：\\\" name=\\\"cleanSession\\\">\\n                        <a-radio-group v-model:value=\\\"formData.cleanSession\\\" placeholder=\\\"请选择是否清除会话（0=false, 1=true）\\\" :options=\\\"cleanSessionOptions\\\" />\\n                    </a-form-item>\\n                </a-col>\\n                <a-col :span=\\\"12\\\">\\n                    <a-form-item label=\\\"心跳间隔（秒）：\\\" name=\\\"keepAliveInterval\\\">\\n                        <a-input-number v-model:value=\\\"formData.keepAliveInterval\\\" :min=\\\"1\\\" :max=\\\"10000\\\" style=\\\"width: 100%\\\" />\\n                    </a-form-item>\\n                </a-col>\\n                <a-col :span=\\\"12\\\">\\n                    <a-form-item label=\\\"连接超时时间（秒）：\\\" name=\\\"connectionTimeout\\\">\\n                        <a-input-number v-model:value=\\\"formData.connectionTimeout\\\" :min=\\\"1\\\" :max=\\\"10000\\\" style=\\\"width: 100%\\\" />\\n                    </a-form-item>\\n                </a-col>\\n                <a-col :span=\\\"12\\\">\\n                    <a-form-item label=\\\"是否自动重连（0=false, 1=true）：\\\" name=\\\"automaticReconnect\\\">\\n                        <a-radio-group v-model:value=\\\"formData.automaticReconnect\\\" placeholder=\\\"请选择是否自动重连（0=false, 1=true）\\\" :options=\\\"automaticReconnectOptions\\\" />\\n                    </a-form-item>\\n                </a-col>\\n                <a-col :span=\\\"12\\\">\\n                    <a-form-item label=\\\"排序码：\\\" name=\\\"sortCode\\\">\\n                        <a-slider v-model:value=\\\"formData.sortCode\\\" :max=\\\"1000\\\" style=\\\"width: 100%\\\" />\\n                    </a-form-item>\\n                </a-col>\\n            </a-row>\\n        </a-form>\\n        <template #footer>\\n            <a-button style=\\\"margin-right: 8px\\\" @click=\\\"onClose\\\">关闭</a-button>\\n            <a-button type=\\\"primary\\\" @click=\\\"onSubmit\\\" :loading=\\\"submitLoading\\\">保存</a-button>\\n        </template>\\n    </xn-form-container>\\n</template>\\n\\n<script setup name=\\\"mqttConnectionConfigForm\\\">\\n    import tool from \'@/utils/tool\'\\n    import { cloneDeep } from \'lodash-es\'\\n    import { required } from \'@/utils/formRules\'\\n    import mqttConnectionConfigApi from \'@/api/biz/mqttConnectionConfigApi\'\\n    // 抽屉状态\\n    const open = ref(false)\\n    const emit = defineEmits({ successful: null })\\n    const formRef = ref()\\n    // 表单数据\\n    const formData = ref({})\\n    const submitLoading = ref(false)\\n    const cleanSessionOptions = ref([])\\n    const automaticReconnectOptions = ref([])\\n\\n    // 打开抽屉\\n    const onOpen = (record) => {\\n        open.value = true\\n        if (record) {\\n            let recordData = cloneDeep(record)\\n            formData.value = Object.assign({}, recordData)\\n        }\\n        cleanSessionOptions.value = tool.dictList(\'OPEN_OFF\')\\n        automaticReconnectOptions.value = tool.dictList(\'OPEN_OFF\')\\n    }\\n    // 关闭抽屉\\n    const onClose = () => {\\n        formRef.value.resetFields()\\n        formData.value = {}\\n        open.value = false\\n    }\\n    // 默认要校验的\\n    const formRules = {\\n        serverHost: [required(\'请输入主机地址\')],\\n        serverPort: [required(\'请输入端口号（如1883）\')],\\n        clientIdPrefix: [required(\'请输入客户端ID前缀\')],\\n    }\\n    // 验证并提交数据\\n    const onSubmit = () => {\\n        formRef.value.validate().then(() => {\\n            submitLoading.value = true\\n            const formDataParam = cloneDeep(formData.value)\\n            mqttConnectionConfigApi\\n                .mqttConnectionConfigSubmitForm(formDataParam, formDataParam.id)\\n                .then(() => {\\n                    onClose()\\n                    emit(\'successful\')\\n                })\\n                .finally(() => {\\n                    submitLoading.value = false\\n                })\\n        })\\n    }\\n    // 抛出函数\\n    defineExpose({\\n        onOpen\\n    })\\n</script>\\n\"},{\"codeFileName\":\"index.vue\",\"codeFileWithPathName\":\"views/biz/mqttconnectionconfig/index.vue\",\"codeFileContent\":\"<template>\\n    <a-card :bordered=\\\"false\\\">\\n        <a-form ref=\\\"searchFormRef\\\" name=\\\"advanced_search\\\" :model=\\\"searchFormState\\\" class=\\\"ant-advanced-search-form\\\">\\n            <a-row :gutter=\\\"24\\\">\\n                <a-col :span=\\\"6\\\">\\n                    <a-form-item label=\\\"主机地址\\\" name=\\\"serverHost\\\">\\n                        <a-input v-model:value=\\\"searchFormState.serverHost\\\" placeholder=\\\"请输入主机地址\\\" />\\n                    </a-form-item>\\n                </a-col>\\n                <a-col :span=\\\"6\\\">\\n                    <a-button type=\\\"primary\\\" @click=\\\"tableRef.refresh(true)\\\">查询</a-button>\\n                    <a-button style=\\\"margin: 0 8px\\\" @click=\\\"reset\\\">重置</a-button>\\n                </a-col>\\n            </a-row>\\n        </a-form>\\n        <s-table\\n            ref=\\\"tableRef\\\"\\n            :columns=\\\"columns\\\"\\n            :data=\\\"loadData\\\"\\n            :alert=\\\"options.alert.show\\\"\\n            bordered\\n            :row-key=\\\"(record) => record.id\\\"\\n            :tool-config=\\\"toolConfig\\\"\\n            :row-selection=\\\"options.rowSelection\\\"\\n        >\\n            <template #operator class=\\\"table-operator\\\">\\n                <a-space>\\n                    <a-button type=\\\"primary\\\" @click=\\\"formRef.onOpen()\\\" v-if=\\\"hasPerm(\'mqttConnectionConfigAdd\')\\\">\\n                        <template #icon><plus-outlined /></template>\\n                        新增\\n                    </a-button>\\n                    <xn-batch-button\\n                        v-if=\\\"hasPerm(\'mqttConnectionConfigBatchDelete\')\\\"\\n                        buttonName=\\\"批量删除\\\"\\n                        icon=\\\"DeleteOutlined\\\"\\n                        :selectedRowKeys=\\\"selectedRowKeys\\\"\\n                        @batchCallBack=\\\"deleteBatchMqttConnectionConfig\\\"\\n                    />\\n                </a-space>\\n            </template>\\n            <template #bodyCell=\\\"{ column, record }\\\">\\n                <template v-if=\\\"column.dataIndex === \'automaticReconnect\'\\\">\\n                    {{ $TOOL.dictTypeData(\'OPEN_OFF\', record.automaticReconnect) }}\\n                </template>\\n                <template v-if=\\\"column.dataIndex === \'action\'\\\">\\n                    <a-space>\\n                        <a @click=\\\"formRef.onOpen(record)\\\" v-if=\\\"hasPerm(\'mqttConnectionConfigEdit\')\\\">编辑</a>\\n                        <a-divider type=\\\"vertical\\\" v-if=\\\"hasPerm([\'mqttConnectionConfigEdit\', \'mqttConnectionConfigDelete\'], \'and\')\\\" />\\n                        <a-popconfirm title=\\\"确定要删除吗？\\\" @confirm=\\\"deleteMqttConnectionConfig(record)\\\">\\n                            <a-button type=\\\"link\\\" danger size=\\\"small\\\" v-if=\\\"hasPerm(\'mqttConnectionConfigDelete\')\\\">删除</a-button>\\n                        </a-popconfirm>\\n                    </a-space>\\n                </template>\\n            </template>\\n        </s-table>\\n    </a-card>\\n    <Form ref=\\\"formRef\\\" @successful=\\\"tableRef.refresh(true)\\\" />\\n</template>\\n\\n<script setup name=\\\"mqttconnectionconfig\\\">\\n    import tool from \'@/utils/tool\'\\n    import { cloneDeep } from \'lodash-es\'\\n    import Form from \'./form.vue\'\\n    import mqttConnectionConfigApi from \'@/api/biz/mqttConnectionConfigApi\'\\n    const searchFormState = ref({})\\n    const searchFormRef = ref()\\n    const tableRef = ref()\\n    const formRef = ref()\\n    const toolConfig = { refresh: true, height: true, columnSetting: true, striped: false }\\n    const columns = [\\n        {\\n            title: \'主机地址\',\\n            dataIndex: \'serverHost\'\\n        },\\n        {\\n            title: \'端口号（如1883）\',\\n            dataIndex: \'serverPort\'\\n        },\\n        {\\n            title: \'用户名\',\\n            dataIndex: \'username\',\\n            ellipsis: true\\n        },\\n        {\\n            title: \'密码\',\\n            dataIndex: \'password\',\\n            ellipsis: true\\n        },\\n        {\\n            title: \'客户端ID前缀\',\\n            dataIndex: \'clientIdPrefix\'\\n        },\\n        {\\n            title: \'是否自动重连（0=false, 1=true）\',\\n            dataIndex: \'automaticReconnect\'\\n        },\\n        {\\n            title: \'排序码\',\\n            dataIndex: \'sortCode\'\\n        },\\n        {\\n            title: \'创建时间\',\\n            dataIndex: \'createTime\'\\n        },\\n    ]\\n    // 操作栏通过权限判断是否显示\\n    if (hasPerm([\'mqttConnectionConfigEdit\', \'mqttConnectionConfigDelete\'])) {\\n        columns.push({\\n            title: \'操作\',\\n            dataIndex: \'action\',\\n            align: \'center\',\\n            width: \'150px\'\\n        })\\n    }\\n    const selectedRowKeys = ref([])\\n    //