nconfig.entity.MqttConnectionConfig;\\nimport vip.xiaonuo.biz.modular.mqttconnectionconfig.mapper.MqttConnectionConfigMapper;\\nimport vip.xiaonuo.biz.modular.mqttconnectionconfig.param.MqttConnectionConfigAddParam;\\nimport vip.xiaonuo.biz.modular.mqttconnectionconfig.param.MqttConnectionConfigEditParam;\\nimport vip.xiaonuo.biz.modular.mqttconnectionconfig.param.MqttConnectionConfigIdParam;\\nimport vip.xiaonuo.biz.modular.mqttconnectionconfig.param.MqttConnectionConfigPageParam;\\nimport vip.xiaonuo.biz.modular.mqttconnectionconfig.service.MqttConnectionConfigService;\\n\\nimport java.util.List;\\n\\n/**\\n * MQTT连接配置表Service接口实现类\\n *\\n * @author Chan\\n * @date  2025/07/18 22:40\\n **/\\n@Service\\npublic class MqttConnectionConfigServiceImpl extends ServiceImpl<MqttConnectionConfigMapper, MqttConnectionConfig> implements MqttConnectionConfigService {\\n\\n\\n    @Override\\n    public Page<MqttConnectionConfig> page(MqttConnectionConfigPageParam mqttConnectionConfigPageParam) {\\n        QueryWrapper<MqttConnectionConfig> queryWrapper = new QueryWrapper<MqttConnectionConfig>().checkSqlInjection();\\n        if(ObjectUtil.isNotEmpty(mqttConnectionConfigPageParam.getServerHost())) {\\n            queryWrapper.lambda().eq(MqttConnectionConfig::getServerHost, mqttConnectionConfigPageParam.getServerHost());\\n        }\\n        if(ObjectUtil.isAllNotEmpty(mqttConnectionConfigPageParam.getSortField(), mqttConnectionConfigPageParam.getSortOrder())) {\\n            CommonSortOrderEnum.validate(mqttConnectionConfigPageParam.getSortOrder());\\n            queryWrapper.orderBy(true, mqttConnectionConfigPageParam.getSortOrder().equals(CommonSortOrderEnum.ASC.getValue()),\\n                    StrUtil.toUnderlineCase(mqttConnectionConfigPageParam.getSortField()));\\n        } else {\\n            queryWrapper.lambda().orderByAsc(MqttConnectionConfig::getSortCode);\\n        }\\n        return this.page(CommonPageRequest.defaultPage(), queryWrapper);\\n    }\\n\\n    @Transactional(rollbackFor = Exception.class)\\n    @Override\\n    public void add(MqttConnectionConfigAddParam mqttConnectionConfigAddParam) {\\n        MqttConnectionConfig mqttConnectionConfig = BeanUtil.toBean(mqttConnectionConfigAddParam, MqttConnectionConfig.class);\\n        this.save(mqttConnectionConfig);\\n    }\\n\\n    @Transactional(rollbackFor = Exception.class)\\n    @Override\\n    public void edit(MqttConnectionConfigEditParam mqttConnectionConfigEditParam) {\\n        MqttConnectionConfig mqttConnectionConfig = this.queryEntity(mqttConnectionConfigEditParam.getId());\\n        BeanUtil.copyProperties(mqttConnectionConfigEditParam, mqttConnectionConfig);\\n        this.updateById(mqttConnectionConfig);\\n    }\\n\\n    @Transactional(rollbackFor = Exception.class)\\n    @Override\\n    public void delete(List<MqttConnectionConfigIdParam> mqttConnectionConfigIdParamList) {\\n        // 执行删除\\n        this.removeByIds(CollStreamUtil.toList(mqttConnectionConfigIdParamList, MqttConnectionConfigIdParam::getId));\\n    }\\n\\n    @Override\\n    public MqttConnectionConfig detail(MqttConnectionConfigIdParam mqttConnectionConfigIdParam) {\\n        return this.queryEntity(mqttConnectionConfigIdParam.getId());\\n    }\\n\\n    @Override\\n    public MqttConnectionConfig queryEntity(String id) {\\n        MqttConnectionConfig mqttConnectionConfig = this.getById(id);\\n        if(ObjectUtil.isEmpty(mqttConnectionConfig)) {\\n            throw new CommonException(\\\"MQTT连接配置表不存在，id值为：{}\\\", id);\\n        }\\n        return mqttConnectionConfig;\\n    }\\n\\n}\\n\"}],\"genBasicCodeMobileResultList\":[{\"codeFileName\":\"page.json\",\"codeFileWithPathName\":\"/page.json\",\"codeFileContent\":\"// 二选一 将代码复制到page.json文件中\\n\\n// 不使用分包\\n{\\n    \\\"path\\\": \\\"pages/biz/mqttconnectionconfig/index\\\",\\n    \\\"style\\\": {\\n        \\\"navigationBarTitleText\\\": \\\"MQTT连接配置表管理\\\",\\n        \\\"enablePullDownRefresh\\\": false,\\n        //#ifdef H5\\n     