\n\\n    // 弹出ref\\n    const popRef = ref()\\n    // 打开\\n    const open = () => {\\n    \\tpopRef.value.open()\\n    }\\n    const reset = () =>{\\n        // 重置数据\\n        props.searchFormData.serverHost = \'\'\\n    \\temits(\'reset\', props.searchFormData)\\n    }\\n    const confirm = () => {\\n    \\tpopRef.value.close()\\n    \\temits(\'confirm\', props.searchFormData)\\n    }\\n    const close = () => {\\n    \\tpopRef.value.close()\\n    }\\n    defineExpose({\\n    \\topen\\n    })\\n</script>\\n<style lang=\\\"scss\\\" scoped>\\n</style>\\n\"},{\"codeFileName\":\"form.vue\",\"codeFileWithPathName\":\"pages/biz/mqttconnectionconfig/form.vue\",\"codeFileContent\":\"<template>\\n    <view class=\\\"snowy-form\\\">\\n        <uni-forms ref=\\\"formRef\\\" :model=\\\"formData\\\" label-position=\\\"top\\\" :rules=\\\"rules\\\" validate-trigger=\\\"blur\\\" labelWidth=\\\"auto\\\">\\n            <uni-forms-item label=\\\"主机地址\\\" name=\\\"serverHost\\\" :required=\\\"true\\\" :rules=\\\"[{ required: true, errorMessage: \'请输入主机地址\' }]\\\">\\n            \\t<uni-easyinput v-model=\\\"formData.serverHost\\\" placeholder=\\\"请输入主机地址\\\"></uni-easyinput>\\n            </uni-forms-item>\\n            <uni-forms-item label=\\\"端口号（如1883）\\\" name=\\\"serverPort\\\" :required=\\\"true\\\" :rules=\\\"[{ required: true, errorMessage: \'请输入端口号（如1883）\' }]\\\">\\n                <uni-number-box v-model=\\\"formData.serverPort\\\" :min=\\\"1\\\" :max=\\\"100\\\"></uni-number-box>\\n            </uni-forms-item>\\n            <uni-forms-item label=\\\"用户名\\\" name=\\\"username\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请输入用户名\' }]\\\">\\n            \\t<uni-easyinput v-model=\\\"formData.username\\\" placeholder=\\\"请输入用户名\\\"></uni-easyinput>\\n            </uni-forms-item>\\n            <uni-forms-item label=\\\"密码\\\" name=\\\"password\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请输入密码\' }]\\\">\\n            \\t<uni-easyinput v-model=\\\"formData.password\\\" placeholder=\\\"请输入密码\\\"></uni-easyinput>\\n            </uni-forms-item>\\n            <uni-forms-item label=\\\"客户端ID前缀\\\" name=\\\"clientIdPrefix\\\" :required=\\\"true\\\" :rules=\\\"[{ required: true, errorMessage: \'请输入客户端ID前缀\' }]\\\">\\n            \\t<uni-easyinput v-model=\\\"formData.clientIdPrefix\\\" placeholder=\\\"请输入客户端ID前缀\\\"></uni-easyinput>\\n            </uni-forms-item>\\n            <uni-forms-item label=\\\"是否清除会话（0=false, 1=true）\\\" name=\\\"cleanSession\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请选择是否清除会话（0=false, 1=true）\' }]\\\">\\n                <uni-data-checkbox :multiple=\\\"false\\\" :map=\\\"{key: \'value\', label: \'text\'}\\\" v-model=\\\"formData.cleanSession\\\" :rangeData=\\\"cleanSessionOptions\\\" placeholder=\\\"请选择是否清除会话（0=false, 1=true）\\\"> </uni-data-checkbox>\\n            </uni-forms-item>\\n            <uni-forms-item label=\\\"心跳间隔（秒）\\\" name=\\\"keepAliveInterval\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请输入心跳间隔（秒）\' }]\\\">\\n                <uni-number-box v-model=\\\"formData.keepAliveInterval\\\" :min=\\\"1\\\" :max=\\\"100\\\"></uni-number-box>\\n            </uni-forms-item>\\n            <uni-forms-item label=\\\"连接超时时间（秒）\\\" name=\\\"connectionTimeout\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请输入连接超时时间（秒）\' }]\\\">\\n                <uni-number-box v-model=\\\"formData.connectionTimeout\\\" :min=\\\"1\\\" :max=\\\"100\\\"></uni-number-box>\\n            </uni-forms-item>\\n            <uni-forms-item label=\\\"是否自动重连（0=false, 1=true）\\\" name=\\\"automaticReconnect\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请选择是否自动重连（0=false, 1=true）\' }]\\\">\\n                <uni-data-checkbox :multiple=\\\"false\\\" :map=\\\"{key: \'value\', label: \'text\'}\\\" v-model=\\\"formData.automaticReconnect\\\" :rangeData=\\\"automaticReconnectOptions\\\" placeholder=\\\"请选择是否自动重连（0=false, 1=true）\\\"> </uni-data-checkbox>\\n            </uni-forms-item>\\n            <uni-forms-item label=\\\"排序码\\\" name=\\\"sortCode\\\" :required=\\\"false\\\" :rules=\\\"[{ required: false, errorMessage: \'请输入排序码\' }]\\\">\\n                <slider :value=\\\"formData.sortCode\\\" :min=\\\"1\\\" :max=\\\"100\\\" :step=\\\"1\\\" @change=\\\"(e)=>{formData.sortCode = e.detail.value}\\\"></slider>\\n            </uni-forms-item>\\n        </uni-forms>\\n        <tui-button margin=\\\"50rpx 0\\\" :preventClick=\\\"true\\\" :shadow=\\\"true\\\" @click=\\\"submit\\\">提交</tui-button>\\n    </view>\\n</template>\\n\\n<script setup name=\\\"mqttConnectionConfigForm\\\">\\n    import { onLoad } from \\\"@dcloudio/uni-app\\\"\\n    import mqttConnectionConfigApi from \'@/api/biz/mqtt-connection-config-api\'\\n    import { reactive, ref, getCurrentInstance } from \\\"vue\\\"\\n    import CallbackState from \\\"@/enum/callback-state\\\"\\n\\n    const { proxy } = getCurrentInstance()\\n    const formRef = ref()\\n    const formData = ref({})\\n    // 常用正则规则大全：https://any86.github.io/any-rule/\\n    // 去pages/biz/user/form.vue中寻找示例\\n    const rules = reactive({\\n    })\\n    const cleanSessionOptions = ref([])\\t\\n    const automaticReconnectOptions = ref([])\\t\\n    onLoad((option) => {\\n        cleanSessionOptions.value = uni.$snowy.tool.dictList(\'OPEN_OFF\')\\n        automaticReconnectOptions.value = uni.$snowy.tool.dictList(\'OPEN_OFF\')\\n        if(!option.id){\\n            return\\n        }\\n        mqttConnectionConfigApi.mqttConnectionConfigDetail({\\n            id: option.id\\n        }).then(data => {\\n            formData.value = data\\n        })\\n    })\\n    const submit = () => {\\n        const submit = () => {\\n            formRef.value.validate().then(res => {\\n                mqttConnectionConfigApi.mqttConnectionConfigSubmitForm(formData.value, !formData.value.id).then(data => {\\n                    uni.$emit(\'formBack\', {\\n                        data: data\\n                    })\\n                    uni.navigateBack({\\n                        delta: 1\\n                    })\\n                })\\n            })\\n        }\\n    }\\n</script>\\n<style lang=\\\"scss\\\" scoped>\\n</style>\\n\"},{\"codeFileName\":\"more.vue\",\"codeFileWithPathName\":\"pages/biz/mqttconnectionconfig/more.vue\",\"codeFileContent\":\"<template>\\n    <uni-popup ref=\\\"popRef\\\" type=\\\"bottom\\\" background-color=\\\"transparent\\\" maskBackgroundColor=\\\"rgba(0, 0, 0, 0.6)\\\">\\n        <tui-list-view unlined=\\\"all\\\" background-color=\\\"transparent\\\">\\n            <tui-list-cell v-if=\\\"$snowy.hasPerm(\'mobileMqttConnectionConfigEdit\')\\\" :hover=\\\"true\\\" :arrow=\\\"false\\\" @click=\\\"edit\\\" :radius=\\\"10\\\" >\\n                <view class=\\\"snowy-text-center\\\"> 编辑 </view>\\n            </tui-list-cell>\\n            <tui-list-cell v-if=\\\"$snowy.hasPerm(\'mobileMqttConnectionConfigDelete\')\\\" :hover=\\\"true\\\" :arrow=\\\"false\\\" @click=\\\"del\\\" :radius=\\\"10\\\" :margin-top=\\\"2\\\">\\n                <view class=\\\"snowy-text-center\\\"> 刪除 </view>\\n            </tui-list-cell>\\n            <tui-list-cell :hover=\\\"true\\\" :arrow=\\\"false\\\" @click=\\\"cancel\\\" :margin-top=\\\"10\\\" :radius=\\\"10\\\">\\n                <view class=\\\"snowy-text-center\\\"> 取消 </view>\\n            </tui-list-cell>\\n        </tui-list-view>\\n    </uni-popup>\\n</template>\\n<script setup name=\\\"mqttConnectionConfigMore\\\">\\n    import mqttConnectionConfigApi from \'@/api/biz/mqtt-connection-config-api\'\\n    import { reactive, ref, getCurrentInstance } from \\\"vue\\\"\\n\\n    const emits = defineEmits([\'handleOk\'])\\n    const popRef = ref()\\n    const record = ref({})\\n    const open = (data) => {\\n    \\trecord.value = data\\n    \\tpopRef.value.open()\\n    }\\n    // 编辑\\n    const edit = () => {\\n    \\tuni.navigateTo({\\n            url: \'/pages/biz/mqttconnectionconfig/form?id=\' + record.value.id\\n    \\t})\\n    \\tpopRef.value.close()\\n    }\\n    // 删除\\n    const del = () => {\\n    \\tuni.$snowy.modal.confirm(`确定要删除吗？`).then(() => {\\n            mqttConnectionConfigApi.mqttConnectionConfigDelete([{\\n                id: record.value.id\\n            }]).then(data => {\\n                emits(\'handleOk\')\\n                popRef.value.close()\\n            })\\n    \\t})\\n    }\\n    // 取消\\n    const cancel = () => {\\n    \\tpopRef.value.close()\\n    }\\n    defineExpose({\\n    \\topen\\n    })\\n</script>\\n<style lang=\\\"scss\\\" scoped>\\n</style>\\n\"},{\"codeFileName\":\"index.vue\",\"codeFileWithPathName\":\"pages/biz/mqttconnectionconfig/index.vue\",\"codeFileContent\":\"<template>\\n    <view>\\n        <z-paging ref=\\\"dataPagingRef\\\" :fixed=\\\"true\\\" use-virtual-list :force-close-inner-list=\\\"true\\\" cell-height-mode=\\\"dynamic\\\" @virtualListChange=\\\"virtualListChange\\\" @query=\\\"loadData\\\" :auto=\\\"true\\\">\\n            <template #top>\\n                <view class=\\\"snowy-z-paging-item\\\">\\n                    <snowy-search placeholder=\\\"请输入主机地址\\\" v-model=\\\"searchFormData.serverHost\\\" @confirm=\\\"$refs.dataPagingRef.reload()\\\" @clear=\\\"$refs.dataPagingRef.reload()\\\" :seniorEnable=\\\"true\\\" @seniorSearch=\\\"$refs.searchRef.open()\\\"></snowy-search>\\n                </view>\\n                <search ref=\\\"searchRef\\\" :searchFormData=\\\"searchFormData\\\" @confirm=\\\"$refs.dataPagingRef.reload()\\\"></search>\\n            </template>\\n            <view class=\\\"snowy-shadow snowy-z-paging-item snowy-padding snowy-hover\\\" v-for=\\\"(item, index) in mqttConnectionConfigData\\\" :key=\\\"index\\\" @tap=\\\"moreTapItem(item, index)\\\">\\n                <uni-row class=\\\"item-uni-row\\\">\\n                    <uni-col :span=\\\"2\\\">\\n                        <uni-icons size=\\\"18\\\" type=\\\"paperclip\\\" color=\\\"#5677fc\\\"></uni-icons>\\n                    </uni-col>\\n                    <uni-col :span=\\\"10\\\">\\n                        <view class=\\\"snowy-sub-title\\\">主机地址</view>\\n                    </uni-col>\\n                    <uni-col :span=\\\"12\\\">\\n                        <view class=\\\"snowy-text-right snowy-text-bold snowy-text-ellipsis\\\"> {{ item.serverHost }} </view>\\n                    </uni-col>\\n                </uni-row>\\n                <uni-row class=\\\"item-uni-row\\\">\\n                    <uni-col :span=\\\"2\\\">\\n                        <uni-icons size=\\\"18\\\" type=\\\"paperclip\\\" color=\\\"#5677fc\\\"></uni-icons>\\n                    </uni-col>\\n                    <uni-col :span=\\\"10\\\">\\n                        <view class=\\\"snowy-sub-title\\\">端口号（如1883）</view>\\n                    </uni-col>\\n                    <uni-col :span=\\\"12\\\">\\n                        <view class=\\\"snowy-text-right snowy-text-bold snowy-text-ellipsis\\\"> {{ item.serverPort }} </view>\\n                    </uni-col>\\n                </uni-row>\\n                <uni-row class=\\\"item-uni-row\\\">\\n                    <uni-col :span=\\\"2\\\">\\n                        <uni-icons size=\\\"18\\\" type=\\\"paperclip\\\" color=\\\"#5677fc\\\"></uni-icons>\\n                    </uni-col>\\n                    <uni-col :span=\\\"10\\\">\\n                        <view class=\\\"snowy-sub-title\\\">用户名</view>\\n                    </uni-col>\\n                    <uni-col :span=\\\"12\\\">\\n                        <view class=\\\"snowy-text-right snowy-text-bold snowy-text-ellipsis\\\"> {{ item.username }} </view>\\n                    </uni-col>\\n                </uni-row>\\n                <uni-row class=\\\"item-uni-row\\\">\\n                    <uni-col :span=\\\"2\\\">\\n                        <uni-icons size=\\\"18\\\" type=\\\"paperclip\\\" color=\\\"#5677fc\\\"></uni-icons>\\n  