             <uni-col :span=\\\"10\\\">\\n                        <view class=\\\"snowy-sub-title\\\">排序码</view>\\n                    </uni-col>\\n                    <uni-col :span=\\\"12\\\">\\n                        <view class=\\\"snowy-text-right snowy-text-bold snowy-text-ellipsis\\\"> {{ item.sortCode }} </view>\\n                    </uni-col>\\n                </uni-row>\\n                <uni-row class=\\\"item-uni-row\\\">\\n                    <uni-col :span=\\\"2\\\">\\n                        <uni-icons size=\\\"18\\\" type=\\\"paperclip\\\" color=\\\"#5677fc\\\"></uni-icons>\\n                    </uni-col>\\n                    <uni-col :span=\\\"10\\\">\\n                        <view class=\\\"snowy-sub-title\\\">创建时间</view>\\n                    </uni-col>\\n                    <uni-col :span=\\\"12\\\">\\n                        <view class=\\\"snowy-text-right snowy-text-bold snowy-text-ellipsis\\\"> {{ item.createTime }} </view>\\n                    </uni-col>\\n                </uni-row>\\n            </view>\\n        </z-paging>\\n        <snowy-float-btn v-if=\\\"$snowy.hasPerm(\'mobileMqttConnectionConfigAdd\')\\\" @click=\\\"add\\\"></snowy-float-btn>\\n        <more ref=\\\"moreRef\\\" @handleOk=\\\"loadData(true)\\\"></more>\\n    </view>\\n</template>\\n\\n<script setup name=\\\"mqttconnectionconfig\\\">\\n    import search from \'./search.vue\'\\n    import mqttConnectionConfigApi from \'@/api/biz/mqtt-connection-config-api\'\\n    import more from \'./more.vue\'\\n    import { onLoad, onShow, onReady, onPullDownRefresh, onReachBottom } from \\\"@dcloudio/uni-app\\\"\\n    import { reactive, ref, getCurrentInstance, nextTick } from \\\"vue\\\"\\n\\n    const { proxy } = getCurrentInstance()\\n    const dataPagingRef = ref()\\n    const searchFormData = ref({})\\n    const mqttConnectionConfigData = ref([])\\n    const virtualListChange = (vList) => {\\n        mqttConnectionConfigData.value = vList\\n    }\\n    const loadData = async (pageNo, pageSize) => {\\n        const parameter = {\\n            current: pageNo,\\n            size: pageSize\\n        }\\n        Object.assign(parameter, searchFormData.value)\\n        const data = await mqttConnectionConfigApi.mqttConnectionConfigPage(parameter)\\n        dataPagingRef.value.complete(data?.records)\\n    }\\n    onShow(() => {\\n        uni.$once(\'formBack\', (data) => {\\n            nextTick(() => {\\n            \\tdataPagingRef.value.reload()\\n            })\\n        })\\n    })\\n    // 新增\\n    const add = () => {\\n        uni.navigateTo({\\n            url: \'/pages/biz/mqttconnectionconfig/form\'\\n        })\\n    }\\n    // 更多操作\\n    const moreRef = ref()\\n    const moreTapItem = (item, index) => {\\n        moreRef.value.open(item)\\n    }\\n</script>\\n\\n<style lang=\\\"scss\\\" scoped>\\n    @import \'@/static/scss/index.scss\';\\n    ::v-deep .uni-row {\\n        @extend .snowy-flex-v-center;\\n        padding: 5rpx;\\n    }\\n</style>\\n\"}]}}', '2025-07-18 22:40:52', '超管', '8bdc8a357dd983ddc8840c43207d0d63387c9820579e44e52ed3a14b35f300043aa89f401acbd384111238df114292a6bcc9d2f7e8f1a0808f9636dc9b48ca0e', '2025-07-18 22:40:52', '-1', NULL, NULL);
